import React from 'react';

import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Hangman from './Hangman';
import './App.css'

const App = () => (
  <Router>
    <nav>
      <Link to="/hangman">Hangman</Link>
      <Routes>
        <Route path="/hangman" element={<Hangman />} />
      </Routes>
    </nav>
  </Router>





)

export default App;
